I saw Payton having lunch at a hot dog stand and I struck up a conversation. After she told me she needed cash for books and other school expenses, I knew I had a chance to convince her to come along with me and have some fun for a price. She was pretty reluctant at first but she agreed because she really needed the extra cash. As much as she enjoyed herself, I think she should have paid me a little something. Her ass was plump and firm and she gave a great sloppy BJ.
